import React from "react";
import { useAuth } from "../components/context/AuthContext";

const PhysioProfile = () => {
  const { user } = useAuth();
  
  onsole.log("Usuário no perfil:", user); // Verifique se o usuário é passado corretamente


  return (
    <div className="p-6 bg-white shadow-lg rounded-lg">
      <h2 className="text-2xl font-semibold mb-4">Perfil</h2>
      <div className="mb-2">
        <strong>Nome:</strong> {user?.name || "Profissional de Saúde"}
      </div>
      <div className="mb-2">
        <strong>Nome de utilizador:</strong> {user?.username || "N/A"}
      </div>
      <div className="mb-2">
        <strong>Data de Registo:</strong> {user?.registrationDate || "N/A"}
      </div>
      <div className="mb-2">
        <strong>Data da última visita:</strong> {user?.lastVisit || "N/A"}
      </div>
    </div>
  );
};

export default PhysioProfile;
